import './App.css';
class App extends React.Component {
  constructor() {
    super();
    this.state = {
      title: 'Weather App',
      city: 'Bucharest'
    }
  }
  render() {
    return (
      <div className="app">
        <div className="header">
          <div className="container">
            <h1>{this.state.title}</h1>
            <p>Powered by T.Valentin</p>
          </div>
        </div>
        <div className="body">
          <div className="container">
            <label htmlFor="city">
              <input id="city" name="city" type="text" />
            </label>
            <button>Weather for</button>
            <h2>Body</h2>
          </div>
        </div>
        <div className="footer">
          <div className="container">
            <h3>Weather App v1 Â© T.Valentin</h3>
          </div>
        </div>
      </div>
    );
  }
}

export default App;
